	<script type="text/javascript">
		$(function(){
			<!-- 右浮层移入移除显示隐藏二维码图标 -->
			$("#app-click").mouseover(function(){
		    	$(".rt-app").show();
	  		});
	  		$("#app-click").mouseout(function(){
		    	$(".rt-app").hide();
	  		});
	  		<!-- 图像延迟加载 -->
			$("img.lazy").lazyload({    
				effect:'fadeIn'
			});
			<!-- 房源列表图像方法集合 -->
			$('.house-image').each(function(){
				<!-- 控制左右翻页箭头是否显示 -->
				$(this).mouseover(function(){
					$(this).find('.change-prev').show();
					$(this).find('.change-next').show();
				}).mouseout(function(){
					$(this).find('.change-prev').hide();
					$(this).find('.change-next').hide();
				});
				<!-- 向左轮播图像 -->
				$(this).find('.change-prev').click(function(){
					var id = $(this).attr('data');
					m.initsrc = $('#' + id)[0].src;
					if(m.roomid != id){
						$('#' + id).attr("src", "http://staticnew.mayi.com/resourcesWeb/images/index/loading.gif");
						$.get("/web/search/getImagesByRoomId",{roomId:id},function(re) {
							if(re.status == 1){
								m.array = re.data;
								m.roomid = id;
								m.array.unshift($('#' + id).attr('data'));
								var index = getArrayIndex(m.array, m.initsrc);
								if(index == 0){
									$('#' + id).attr("src", m.initsrc);
								}
								$('#' + id).attr("src", m.array[index - 1]);
							}else{
								$('#' + id).attr("src", m.initsrc);
								return false;
							}
						},'JSON');
					}else{
						var index = getArrayIndex(m.array, m.initsrc);
						if(index >= 1){
							$('#' + id).attr("src", "http://staticnew.mayi.com/resourcesWeb/images/index/loading.gif");
						}
						$('#' + id).attr("src", m.array[index - 1]);
					}
				});
				<!-- 向右轮播图像 -->
				$(this).find('.change-next').click(function(){
					var id = $(this).attr('data');
					m.initsrc = $('#' + id)[0].src;
					if(m.roomid != id){
						$('#' + id).attr("src", "http://staticnew.mayi.com/resourcesWeb/images/index/loading.gif");
						$.get("/web/search/getImagesByRoomId",{roomId:id},function(re) {
							if(re.status == 1){
								m.array = re.data;
								m.roomid = id;
								m.array.unshift($('#' + id).attr('data'));
								var index = getArrayIndex(m.array, m.initsrc);
								$('#' + id).attr("src", m.array[index + 1]);
							}else{
								$('#' + id).attr("src", m.initsrc);
								return false;
							}
						},'JSON');
					}else{
						var index = getArrayIndex(m.array, m.initsrc);
						if(index < m.array.length - 1){
							$('#' + id).attr("src", "http://staticnew.mayi.com/resourcesWeb/images/index/loading.gif");
						}
						$('#' + id).attr("src", m.array[index + 1]);
					}
				});
			});
